import React, { useState } from 'react';
import './index.css';
import { questions } from './Api.jsx'
import MyAccordion from './MyAccordion';

const Accordion = () => {
    const [data, setData] = useState(questions)
    return (
        <>
            {
                data.map((val) => {
                    return <MyAccordion/>;
                })
            }
        </>
    );
}

export default Accordion
